export default function SpacingGrid() {
    const [spacing, setSpacing] = React.useState(2);
    const classes = useStyles();
  
    function handleChange(event, value) {
      setSpacing(Number(value));
    }
  
    return (
      <Grid container spacing={2}>
        <Grid item xs={6}></Grid>
        <Grid item xs={6}></Grid>
      </Grid>
    );
  }
